oxy_webhelp_navlinks = {"work_spaces_to_handle_tasks-d1827e180":{"topics":[{"title":"Workspaces for Bank's Employee (WAC)","shortdesc":"<p class=\"shortdesc\">Bank's Employee workspace is a desktop or a mobile page that is opened as bank's         employees log in to their banking application. Bank's Employee manage their banking         operations using Roles, so each role may have it's own workspace.<\/p>","href":"topics\/bank_s_employee_app_ui.html","attributes":{"data-id":"bank_s_employee_app_ui"},"menu":{"hasChildren":false},"tocID":"bank_s_employee_app_ui-d1827e191","topics":[]},{"title":"Workspaces for Corporate Client (Business)","shortdesc":"<p class=\"shortdesc\">Bank's Corporate Client workspace is a desktop or a mobile page that is opened as         bank's corporate clients log in to their internet banking application. Corporate clients         manage their banking operations using Roles, such as bookkeeper, CEO, CFO etc., so each role         may have it's own workspace.<\/p>","href":"topics\/bank_s_corporate_client_app_ui.html","attributes":{"data-id":"bank_s_corporate_client_app_ui"},"menu":{"hasChildren":false},"tocID":"bank_s_corporate_client_app_ui-d1827e202","topics":[]},{"title":"Workspaces for Private Client (Retail)","shortdesc":"<p class=\"shortdesc\">Workspace for Private Client is a desktop or a mobile UI starting page that is         designed for Private Client role. The workspace is opened as Private Clients login to the         internet banking application. Private Clients manage their banking operations within         workspace.<\/p>","href":"topics\/bank_s_privat_client_app_ui.html","attributes":{"data-id":"bank_s_privat_client_app_ui"},"menu":{"hasChildren":true},"tocID":"bank_s_privat_client_app_ui-d1827e213","next":"bank_s_privat_client_app_ui-d1827e213"}]}};